/* The printf's may be removed to isolate just the math calculations */
#define BITSPERLONG 32

#define TOP2BITS(x) ((x & (3L << (BITSPERLONG-2))) >> (BITSPERLONG-2))

struct int_sqrt {
      unsigned sqrt,
               frac;
};


void SolveCubic(int  a,
                int  b,
                int  c,
                int  d,
                int  *solutions,
                int *x)
{
      int a1 = fpdiv(b,a);
      int a2 = fpdiv(c,a);
      int a3 = fpdiv(d,a);
      int tmp1 = fpsub(fpmul(a1,a1) , fpmul(a2,0x40400000));//fpmul(a2,3.0);
      int  Q = fpdiv(tmp1,0x41100000);//fpdiv(tmp1,9.0);


      tmp1 = fpmul(0x40000000,a1);//fpmul(2.0,a1);
      tmp1 = fpmul(tmp1,a1);
      tmp1 = fpmul(tmp1,a1);
      int tmp2 = fpmul(0x41100000,a1);//fpmul(9.0,a1);
      tmp2 = fpmul(tmp2,a2);
      int tmp3 = fpmul(0x41d80000,a3);//fpmul(27.0,a3)
      tmp1 = fpsub(tmp1,tmp2);
      tmp1 = fpadd(tmp1,tmp3);
      int  R = fpdiv(tmp1,0x42580000);//fpdiv(tmp1,54.0);

    tmp1 = fpmul(R,R);
    tmp2 = fpmul(Q,Q);
    tmp2 = fpmul(tmp2,Q);

    int R2_Q3 = fpsub(tmp1,tmp2);


      if (fp_ExtractSign(R2_Q3))
      {
            *solutions = 3;
            int theta = fp_Cos(fpdiv(R,fp_Sqrt(fpmul(fpmul(Q,Q),Q))));
            tmp1 = fpmul(0x40000000,Q);//2.0
            tmp2 = fp_Cos(fpdiv(theta,0x40400000));//3.0
            tmp3 = fpdiv(a1,0x40400000);//3.0
            x[0] = fpsub(fpmul(tmp1,tmp2),tmp3);

            tmp2 = fp_Cos(fpdiv(theta,0x40400000));//3.0
            tmp3 = fpdiv(a1,0x40400000);//3.0
            x[0] = fpsub(fpmul(tmp1,tmp2),tmp3);

            tmp2 = fp_Cos(fpdiv(fpadd(theta,fpmul(0x40000000,0x4048f5c3)),0x40400000));//2.0 , 3.14 , 3.0
            tmp3 = fpdiv(a1,0x40400000);//3.0
            x[1] = fpsub(fpmul(tmp1,tmp2),tmp3);

            tmp2 = fp_Cos(fpdiv(fpadd(theta,fpmul(0x40800000,0x40400000)),0x40400000));//4.0 , 3.0 , 3.0
            tmp3 = fpdiv(a1,0x40400000);//3.0
            x[2] = fpsub(fpmul(tmp1,tmp2),tmp3);
      }
      else
      {
            *solutions = 1;
            x[0] = fp_Pow(fpadd(fp_Sqrt(R2_Q3),fp_Fabs(R)),fpdiv(0x3f800000,0x40400000));//1.0,3.0
            x[0] = fpadd(x[0],fpadd(Q,x[0]));
            if(fp_ExtractSign(R))
              x[0] &= 0x7FFFFFFF;
            else
              x[0] |= 0x80000000;
            x[0] = fpsub(x[0], fpdiv(a1,0x40400000));//3.0
      }
}

